import React, { Component } from 'react'
import Search from './Search';

export default class Nav extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <span>Weather app</span>
                <Search onSearch={this.props.onSearch}/>
            </div>
        );
    }
}
